import React from "react"
import Navbar from "./navbar"

function Home() {
    return(
        <div>
            <Navbar></Navbar>
            <div>
                <p> 
                Welcome to Haven! A realm where you can play Dungeons & Dragons, go on epic quests, roleplay with your favorite characters and much more!
                Haven is an expansive D&D 5e discord server with Adventure League style play, over 50+ roleplay channels, homebrew rulesets for crafting, guilds, pets & mounts and more! 
                </p>
            </div>
        </div>   
    )
}

export default Home;
